/**
 * request to server and backend
 * @param command
 * @param data
 * @param filter
 * @param callback
 * @private
 */
Remote.prototype._submit = function(command, data, filter, callback) {
    if (!callback || typeof callback !== 'function') {
        callback = function() {};
    }
    var req_id = this._server.sendMessage(command, data);
    this._requests[req_id] = {
        command: command,
        data: data,
        filter: filter,
        callback: callback
    };
};

